const ImmigrationtoSouthafrica  = () => {
  return (
    
      <div className="southafricaimmigrationcomponents">
        {" "}
        <img className='southafricaimmigrationcomponentsimg' src={Southafricaimmigration} width="320px" height="274px" ></img>{" "}
        <p className="southafricaimmigrationcomponentsone">usaapplication </p>
        <p className='southafricaimmigrationcomponentstwo'>Studying abroad is all about choosing the right destination, university and course. Read along some interesting articles to make the most of your international education experience. </p>
      </div>
    
  );
};

